    const [ description, setDescription ] = useState('')
    const [ img, setImg ] = useState('')
    const [ rating, setRating ] = useState('')


    return (
        <div>
            <form>
                <label>Brand</label>
                <input
                    onChange={(e) => setBrand}
                />
            </form>  
        </div>
    )
}

export default CigarForm
